class keyState {
  public bool midiState = false, seqState = false, touchState = false;
  public bool currentNonSeqState = false;

  public bool getState() {
    if (midiState) return true;
    if (seqState) return true;
    return touchState;
  }

  public bool nonSeqStateChange() {
    if (!seqState && currentNonSeqState) return true;
    return false;
  }
}


class midiOutOfRange : MonoBehaviour {
  public float waitTime = 5;
  public GameObject obj;

  public void Activate() {
    obj.SetActive(true);
    StartCoroutine(wait());
  }

  IEnumerator wait() {
    yield return new WaitForSeconds(waitTime);
    obj.SetActive(false);
  }
}

